import React from 'react';
import ItemFlatCard from '../commons/cards/itemFlatCard';

const CategoryProducts = () =>{

    const data =[];
   return <section className="category-product-area home-10">
    <div className="container">
      <div className="row">
         <div className="col-xs-12 col-md-12 col-lg-12 col-xl-9">
            <div className="row">
                  {data.map((item,index)=>{
                     return <div className="col-xs-12 col-md-12 col-lg-4">
                          <div className="section-title">
                            <h2>{item.title}</h2>
                           </div>
                           <div className="category-product-slider owl-carousel responsive-owl-nav-style owl-nav-style">

                                 {item.items.map((item,index)=>{
                                        return <div className="feature-slider-item">
                                                    {item.products.map((items,index)=>{
                                                      return <ItemFlatCard
                                                                  title={item.title}
                                                                  image1={item.image1}
                                                                  image2={item.image2}
                                                                  description={item.description}
                                                                  id={item.id}
                                                                  price={item.price}
                                                                  rating={item.rating}
                                                            />
                                                    })}
                                               </div>
                                 })}

                            </div>

                      </div>
                  })}

             </div>
          </div>
       </div>
     </div>
    </section>
}

export default CategoryProducts;
